const Main = () => {

    const [cigarList, setCigarList] = useState([])

    

    return (
        
        <div >
            <NavBar />
            <div>

            </div>
            <CigarForm 
            cigarList={cigarList} 
            setCigarList={setCigarList} />

            <hr style={{margin:'0'}}/>

            <AllCigars 
            cigarList={cigarList} 
            setCigarList={setCigarList}
            />

        </div>
    )
}

export default Main
